CREATE DATABASE IF NOT EXISTS `kasir_project`;
USE `kasir_project`;

CREATE TABLE `cache` (
  `key` varchar(255) NOT NULL,
  `value` mediumtext NOT NULL,
  `expiration` int(11) NOT NULL,
  PRIMARY KEY (`key`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE `cache_locks` (
  `key` varchar(255) NOT NULL,
  `owner` varchar(255) NOT NULL,
  `expiration` int(11) NOT NULL,
  PRIMARY KEY (`key`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE `failed_jobs` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `uuid` varchar(255) NOT NULL,
  `connection` text NOT NULL,
  `queue` text NOT NULL,
  `payload` longtext NOT NULL,
  `exception` longtext NOT NULL,
  `failed_at` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `failed_jobs_uuid_unique` (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE `job_batches` (
  `id` varchar(255) NOT NULL,
  `name` varchar(255) NOT NULL,
  `total_jobs` int(11) NOT NULL,
  `pending_jobs` int(11) NOT NULL,
  `failed_jobs` int(11) NOT NULL,
  `failed_job_ids` longtext NOT NULL,
  `options` mediumtext DEFAULT NULL,
  `cancelled_at` int(11) DEFAULT NULL,
  `created_at` int(11) NOT NULL,
  `finished_at` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE `jobs` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `queue` varchar(255) NOT NULL,
  `payload` longtext NOT NULL,
  `attempts` tinyint(3) unsigned NOT NULL,
  `reserved_at` int(10) unsigned DEFAULT NULL,
  `available_at` int(10) unsigned NOT NULL,
  `created_at` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `jobs_queue_index` (`queue`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE `logs` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` text DEFAULT NULL,
  `ip` text DEFAULT NULL,
  `activity` text DEFAULT NULL,
  `session_id` text DEFAULT NULL,
  `name_table` text DEFAULT NULL,
  `ref_id` text DEFAULT NULL,
  `json` longtext DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=506 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `migrations` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `migration` varchar(255) NOT NULL,
  `batch` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `ms_brand` (
  `id_brand` char(36) NOT NULL,
  `name_brand` text DEFAULT NULL,
  `company_brand` char(36) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_brand`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `ms_category` (
  `id_category` char(36) NOT NULL,
  `name_category` text DEFAULT NULL,
  `company_category` char(36) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_category`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `ms_company` (
  `id_company` char(36) NOT NULL,
  `name_company` text DEFAULT NULL,
  `rate_company` double DEFAULT NULL,
  `phone_company` text DEFAULT NULL,
  `address_company` text DEFAULT NULL,
  `description_company` text DEFAULT NULL,
  `start_date_company` date DEFAULT NULL,
  `end_date_company` date DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_company`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `ms_customer` (
  `id_customer` char(36) NOT NULL,
  `name_customer` text DEFAULT NULL,
  `phone_customer` varchar(30) DEFAULT NULL,
  `company_customer` char(36) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_customer`),
  UNIQUE KEY `ms_customer_phone_customer_unique` (`phone_customer`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `ms_groupmodule` (
  `id_gmd` char(36) NOT NULL,
  `level_gmd` text DEFAULT NULL,
  `module_gmd` text DEFAULT NULL,
  `action_gmd` text DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_gmd`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `ms_level` (
  `id_level` char(36) NOT NULL,
  `code_level` text DEFAULT NULL,
  `name_level` text DEFAULT NULL,
  `company_level` text DEFAULT NULL,
  `show_level` tinyint(4) NOT NULL DEFAULT 1,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_level`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `ms_method_payment` (
  `id_mp` char(36) NOT NULL,
  `name_mp` text DEFAULT NULL,
  `company_mp` char(36) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_mp`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `ms_module` (
  `id_module` char(36) NOT NULL,
  `induk_module` char(36) DEFAULT '0',
  `code_module` char(15) NOT NULL,
  `name_module` varchar(100) NOT NULL,
  `link_module` varchar(255) NOT NULL,
  `description_module` mediumtext DEFAULT NULL,
  `icon_module` varchar(50) NOT NULL,
  `action_module` mediumtext NOT NULL,
  `order_module` tinyint(4) NOT NULL,
  `show_module` tinyint(4) NOT NULL DEFAULT 1,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id_module`),
  UNIQUE KEY `code_module` (`code_module`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `ms_option` (
  `id_option` int(11) NOT NULL,
  `company_option` text DEFAULT NULL,
  `name_company` varchar(100) NOT NULL,
  `address_company` varchar(100) NOT NULL,
  `phone_company` varchar(50) NOT NULL,
  `fax_company` varchar(50) NOT NULL,
  `email_company` varchar(50) NOT NULL,
  `logo` varchar(255) NOT NULL,
  `favicon` varchar(255) NOT NULL,
  `description` varchar(255) NOT NULL,
  `starthour_company` time DEFAULT NULL,
  `endhour_company` time DEFAULT NULL,
  `latitude_company` varchar(100) NOT NULL,
  `longitude_company` varchar(100) NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id_option`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `ms_product` (
  `id_product` char(36) NOT NULL,
  `name_product` text DEFAULT NULL,
  `category_product` char(36) DEFAULT NULL,
  `unit_product` char(36) DEFAULT NULL,
  `brand_product` char(36) DEFAULT NULL,
  `hpp_product` double DEFAULT NULL COMMENT 'harga pokok pembelian',
  `price_product` double DEFAULT NULL COMMENT 'harga jual',
  `image_product` text DEFAULT NULL,
  `company_product` char(36) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_product`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `ms_supplier` (
  `id_supplier` char(36) NOT NULL,
  `name_supplier` text DEFAULT NULL,
  `phone_supplier` varchar(30) DEFAULT NULL,
  `address_supplier` text DEFAULT NULL,
  `description_supplier` text DEFAULT NULL,
  `company_supplier` char(36) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_supplier`),
  UNIQUE KEY `ms_supplier_phone_supplier_unique` (`phone_supplier`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `ms_unit` (
  `id_unit` char(36) NOT NULL,
  `name_unit` text DEFAULT NULL,
  `company_unit` varchar(36) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_unit`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `password_reset_tokens` (
  `email` varchar(255) NOT NULL,
  `token` varchar(255) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE `personal_access_tokens` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `tokenable_type` varchar(255) NOT NULL,
  `tokenable_id` bigint(20) unsigned NOT NULL,
  `name` varchar(255) NOT NULL,
  `token` varchar(64) NOT NULL,
  `abilities` text DEFAULT NULL,
  `last_used_at` timestamp NULL DEFAULT NULL,
  `expires_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `personal_access_tokens_token_unique` (`token`),
  KEY `personal_access_tokens_tokenable_type_tokenable_id_index` (`tokenable_type`,`tokenable_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE `sessions` (
  `id` varchar(255) NOT NULL,
  `user_id` bigint(20) unsigned DEFAULT NULL,
  `ip_address` varchar(45) DEFAULT NULL,
  `user_agent` text DEFAULT NULL,
  `payload` longtext NOT NULL,
  `last_activity` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `sessions_user_id_index` (`user_id`),
  KEY `sessions_last_activity_index` (`last_activity`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `tb_stock_opname` (
  `id_so` char(36) NOT NULL,
  `type_so` char(1) DEFAULT NULL COMMENT 'S: Sales, P: Purchase',
  `product_so` char(36) DEFAULT NULL COMMENT 'Product',
  `qty_so` double DEFAULT NULL COMMENT 'quantity',
  `hpp_so` double DEFAULT NULL,
  `price_so` double DEFAULT NULL,
  `grand_total_so` double DEFAULT NULL COMMENT 'total semua price * quantity',
  `date_so` date DEFAULT NULL COMMENT 'tanggal',
  `day_so` int(11) DEFAULT NULL,
  `month_so` int(11) DEFAULT NULL,
  `year_so` int(11) DEFAULT NULL,
  `company_so` char(36) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_so`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `tb_transaction` (
  `id_trx` char(36) NOT NULL,
  `type_trx` char(1) DEFAULT NULL COMMENT 'S: Sales, P: Purchase',
  `supplier_trx` char(36) DEFAULT NULL COMMENT 'Supplier',
  `customer_trx` char(36) DEFAULT NULL COMMENT 'Customer',
  `code_trx` text DEFAULT NULL COMMENT 'kode transaksi',
  `total_trx` double DEFAULT NULL COMMENT 'total transaksi tanpa diskon',
  `discount_persen_trx` double DEFAULT NULL COMMENT 'diskon persen',
  `discount_nominal_trx` double DEFAULT NULL COMMENT 'diskon nominal',
  `grand_total_trx` double DEFAULT NULL COMMENT 'total semua dengan diskon',
  `method_payment_trx` text DEFAULT NULL,
  `amount_received_trx` double DEFAULT NULL COMMENT 'uang diterima saat penjualan',
  `amount_given_trx` double DEFAULT NULL COMMENT 'uang yang keluar saat pembelian',
  `change_given_trx` double DEFAULT NULL COMMENT 'uang di kembalian baik dari penjualan dan pembelian',
  `date_trx` date DEFAULT NULL,
  `company_trx` char(36) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_trx`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `tb_transaction_detail` (
  `id_trd` char(36) NOT NULL,
  `trx_trd` char(36) DEFAULT NULL COMMENT 'id trx',
  `product_trd` char(36) DEFAULT NULL COMMENT 'id product',
  `order_trd` int(11) DEFAULT NULL COMMENT 'order',
  `qty_trd` double DEFAULT NULL COMMENT 'quantity',
  `hpp_trd` double DEFAULT NULL COMMENT 'harga pokok pembelian',
  `price_trd` double DEFAULT NULL COMMENT 'harga jual',
  `total_trd` double DEFAULT NULL COMMENT 'total transaksi tanpa diskon, harga jual * quantity',
  `discount_persen_trd` double DEFAULT NULL COMMENT 'diskon persen',
  `discount_nominal_trd` double DEFAULT NULL COMMENT 'diskon nominal',
  `grand_total_trd` double DEFAULT NULL COMMENT 'total semua dengan diskon',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id_trd`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



CREATE TABLE `users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `username` varchar(100) NOT NULL,
  `level_user` text DEFAULT NULL,
  `company_user` text DEFAULT NULL,
  `status_user` tinyint(4) DEFAULT NULL COMMENT 'pengecekan untuk login',
  `email` varchar(255) DEFAULT NULL,
  `email_verified_at` timestamp NULL DEFAULT NULL,
  `password` varchar(255) NOT NULL,
  `remember_token` varchar(100) DEFAULT NULL,
  `show_user` tinyint(4) DEFAULT 1 COMMENT 'disembunyikan saat list user saja',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`),
  UNIQUE KEY `users_email_unique` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



